INSERT INTO `announcements` VALUES (1,1,NULL,'Editor Slideouts','Double-click entries and other editable elements to try the new editor slideout interface.',0,'2022-11-01 15:18:13','2021-11-01 10:08:54'),(2,1,NULL,'Streamlined Entry Publishing Flow','The entry publishing workflow is now [simpler and more intuitive](https://craftcms.com/knowledge-base/editing-entries).',0,'2022-11-01 15:18:13','2021-11-01 10:08:54'),(3,1,9,'t9n:[\"freeform\",\"New Floating Labels formatting template\",[]]','t9n:[\"freeform\",\"The [Floating Labels]({url}) formatting template is ready-to-go and requires no frameworks or toolkits.\",{\"url\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/templates\\/formatting\\/basic-floating-labels\\/\"}]',0,'2024-10-07 15:10:41','2023-05-26 08:39:32'),(4,1,9,'t9n:[\"freeform\",\"New Demo Templates area!\",[]]','t9n:[\"freeform\",\"Completely revamped [demo templates]({url})! Quickly try on a wide range of sample formatting templates on your forms, view submission data, check out advanced setups and more.\",{\"url\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/setup\\/demo-templates\\/\"}]',0,'2024-10-07 15:10:41','2023-05-26 08:39:32'),(5,1,9,'t9n:[\"freeform\",\"Parse Twig inside Predefined Assets feature\",[]]','t9n:[\"freeform\",\"Set [Predefined Assets]({url}) dynamically from a field value, allowing the user\'s selection to determine which asset(s) to include in the email notification.\",{\"url\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/overview\\/email-notifications\\/#template-options\"}]',0,'2024-10-07 15:10:41','2023-05-26 08:39:32'),(6,1,9,'t9n:[\"freeform\",\"Map to Craft Entry postDate or expiryDate\",[]]','t9n:[\"freeform\",\"When using the [Element Connections]({url}) feature, you can now map Freeform fields to Craft Entry \\\"postDate\\\" and \\\"expiryDate\\\".\",{\"url\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/integrations\\/elements\\/\"}]',0,'2024-10-07 15:10:41','2023-05-26 08:39:32'),(7,1,9,'t9n:[\"freeform\",\"Limit form submissions by Email Address\",[]]','t9n:[\"freeform\",\"You can now prevent users from submitting a form more than once when [using the same email address]({url}) on any Email field.\",{\"url\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/overview\\/submission-limits\\/\"}]',0,'2024-10-07 15:10:41','2023-05-26 08:39:32'),(8,1,9,'t9n:[\"freeform\",\"Improved GraphQL \\/ Headless support!\",[]]','t9n:[\"freeform\",\"Added support for [GraphQL Mutations]({url1}) and significantly improved support for [headless implementations]({url2}).\",{\"url1\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/headless\\/graphql\\/\",\"url2\":\"https:\\/\\/docs.solspace.com\\/craft\\/freeform\\/v4\\/headless\\/\"}]',0,'2024-10-07 15:10:41','2023-09-20 13:14:42');
